import { Helmet } from "react-helmet";

import Layout from './Layout';
import GlobalStyle from './styles/globals';

export default function App() {
    return (
      <>
        <Helmet>
          <link
              href="https://fonts.googleapis.com/css2?family=Anton&family=Karla:wght@200&family=Ubuntu+Mono&display=swap"
              rel="stylesheet"
          />
        </Helmet>
        <Layout />
        <GlobalStyle/>
      </>
    );
}
